class Solution {

    /**
     * @param Integer $purchaseAmount
     * @return Integer
     */
    function accountBalanceAfterPurchase($purchaseAmount) {
        // Rounding to the nearest multiple of 10. If it's exactly in the middle, choose the larger multiple.
        $roundedAmount = ceil($purchaseAmount / 10) * 10;

        // Calculate the new balance after the purchase.
        $newBalance = 100 - $roundedAmount;

        return $newBalance;
    }
}
